import React from 'react';
import { View, Text, Image, TouchableOpacity } from 'react-native';

const AssetItem = () => {
  return (
    <View style={styles.container}>
      <View style={styles.leftContent}>
        <Image style={styles.logo} source={require('../assets/bitcoinsvgrepocom-1.svg')} />
        <Text style={styles.span}>Crypto</Text>
      </View>
      <View style={styles.rightContent}>
        <Text style={styles.decimal}>.60</Text>
        <TouchableOpacity style={styles.button}>
          <Text style={styles.changePercentage}>+7.90%</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = {
  container: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between',
    padding: 16,
    borderBottomWidth: 1,
    borderBottomColor: '#E5E5E5',
  },
  leftContent: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  logo: {
    width: 24,
    height: 24,
    marginRight: 8,
  },
  span: {
    fontSize: 14,
    color: '#888888',
  },
  rightContent: {
    alignItems: 'flex-end',
  },
  decimal: {
    fontSize: 12,
    color: '#888888',
  },
  button: {
    backgroundColor: '#F5F5F5',
    paddingVertical: 4,
    paddingHorizontal: 10,
    borderRadius: 8,
    marginTop: 8,
  },
  changePercentage: {
    fontSize: 12,
    fontWeight: 'bold',
    color: '#008000',
  },
};

export default AssetItem;





















